import React from 'react'
import Last11 from '../Last1/Last11'
import last from './last.css'
function Last({data}) {
  return (
    <>
    <div className='lastt'>
       <p className='pp'>More from the Siren</p>
       <div className='hrr'></div>
       <div className='last11'>
        {
          data.map((item)=>{
            return(
              <>
               <Last11 data={item}/>
              </>
            )
          })
        }
           
       </div>
    </div>
    </>
  )
}

export default Last
